package net.bodz.bas.util.cache;

public class LoadContentException
        extends Exception {

    private static final long serialVersionUID = 1L;

    public LoadContentException() {
        super();
    }

    public LoadContentException(String message, Throwable cause) {
        super(message, cause);
    }

    public LoadContentException(String message) {
        super(message);
    }

    public LoadContentException(Throwable cause) {
        super(cause);
    }

}
